-- ----------------------------
-- Procedure structure for incidencias_validadas_por_alcalde_vecinal
-- ----------------------------
DROP PROCEDURE IF EXISTS `incidencias_validadas_por_alcalde_vecinal`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `incidencias_validadas_por_alcalde_vecinal`(
	IN fecha_inicio VARCHAR(12),
	IN fecha_final VARCHAR(12)
)
BEGIN
	IF(fecha_inicio = '' AND fecha_final = '') THEN

		SELECT p.id, p.nombres, p.ape_paterno, p.ape_materno, p.dni, x.total 
		FROM persona AS p,
		(
		SELECT i.persona_id_validador, count(i.estado_incidente_id) AS total FROM incidente AS i
		WHERE i.estado_incidente_id = 2
		GROUP BY i.persona_id_validador
		) AS x
		WHERE p.id = x.persona_id_validador;

	ELSEIF(fecha_inicio != '' AND fecha_final = '') THEN

		SELECT p.id, p.nombres, p.ape_paterno, p.ape_materno, p.dni, x.total 
		FROM persona AS p,
		(
		SELECT i.persona_id_validador, count(i.estado_incidente_id) AS total FROM incidente AS i
		WHERE i.estado_incidente_id = 2
		AND i.created_at >= fecha_inicio
		GROUP BY i.persona_id_validador
		) AS x
		WHERE p.id = x.persona_id_validador;

	ELSEIF(fecha_inicio != '' AND fecha_final != '') THEN

		SELECT p.id, p.nombres, p.ape_paterno, p.ape_materno, p.dni, x.total 
		FROM persona AS p,
		(
		SELECT i.persona_id_validador, count(i.estado_incidente_id) AS total FROM incidente AS i
		WHERE i.estado_incidente_id = 2
		AND i.created_at >= fecha_inicio AND i.created_at <= fecha_final
		GROUP BY i.persona_id_validador
		) AS x
		WHERE p.id = x.persona_id_validador;

	ELSE

		SELECT p.id, p.nombres, p.ape_paterno, p.ape_materno, p.dni, x.total 
		FROM persona AS p,
		(
		SELECT i.persona_id_validador, count(i.estado_incidente_id) AS total FROM incidente AS i
		WHERE i.estado_incidente_id = 2
		AND i.created_at <= fecha_final
		GROUP BY i.persona_id_validador
		) AS x
		WHERE p.id = x.persona_id_validador;

	END IF;

END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for pa_ciudadanos_por_puntuacion
-- ----------------------------
DROP PROCEDURE IF EXISTS `pa_ciudadanos_por_puntuacion`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `pa_ciudadanos_por_puntuacion`()
BEGIN
	SELECT 
		pp.persona_id, p.nombres, p.ape_paterno, p.ape_materno, p.dni, p.telefono, 
		p.mail, p.direccion, sum(puntaje) AS total 
	FROM actividad_puntuacion AS ap,
	puntuacion_persona as pp, persona AS p
	WHERE ap.id = pp.actividad_puntuacion_id
	AND pp.persona_id = p.id
	AND p.tipo_persona_id = 2
	GROUP BY (pp.persona_id)
	ORDER BY total DESC;

END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for pa_ciudadanos_por_puntuacion_update
-- ----------------------------
DROP PROCEDURE IF EXISTS `pa_ciudadanos_por_puntuacion_update`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `pa_ciudadanos_por_puntuacion_update`()
    COMMENT 'Procedimiento almacenado que la lista la puntuación de cada ciudadano'
BEGIN
	SELECT 
		pp.persona_id, p.nombres, p.ape_paterno, p.ape_materno, p.dni, p.telefono, 
		p.mail, p.direccion, r.descripcion AS nombre_rol, sum(puntaje) AS total,
		(
	CASE 
		WHEN sum(puntaje) <= 100 THEN 'Bronce'
		WHEN sum(puntaje) >= 101 && sum(puntaje) <= 200 THEN 'Plata'
		WHEN sum(puntaje) >= 201 &&  sum(puntaje) <= 300 THEN 'Oro'
		WHEN sum(puntaje) >= 301 THEN 'Platino'
		ELSE ""
	END) AS nivel	
	FROM actividad_puntuacion AS ap,
	puntuacion_persona as pp, persona AS p, rol AS r
	WHERE ap.id = pp.actividad_puntuacion_id
	AND pp.persona_id = p.id
	AND p.tipo_persona_id = 2
	AND p.rol_id = r.id
	GROUP BY (pp.persona_id)
	ORDER BY total DESC;
END
;;
DELIMITER ;

