-- ----------------------------
-- Procedure structure for pa_incidentes_atendidos
-- ----------------------------
DROP PROCEDURE IF EXISTS `pa_incidentes_atendidos`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `pa_incidentes_atendidos`()
BEGIN
	SELECT 
		i.id, 
		DATE_FORMAT(i.fecha,"%d/%m/%Y") as fecha_registro, 
		DATE_FORMAT(ai.fecha, "%d/%m/%Y") as fecha_atencion,
		i.descripcion, 
		i.direccion, 
		i.latitud, 
		i.longitud, 
		u.descripcion AS nombre_urbanizacion
	FROM incidente 
		AS i, 
		atencion_incidente AS ai, 
		urbanizacion AS u
	WHERE ai.incidente_id = i.id
	AND i.urbanizacion_id = u.id;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for pa_incidentes_por_atender
-- ----------------------------
DROP PROCEDURE IF EXISTS `pa_incidentes_por_atender`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `pa_incidentes_por_atender`()
BEGIN
	SELECT
		i.id,
		DATE_FORMAT(i.fecha,"%d/%m/%Y") AS fecha_registro, 
		i.descripcion,
		i.direccion,
		i.latitud,
		i.longitud,
		u.descripcion AS nombre_urbanizacion
	FROM
		incidente AS i,
		urbanizacion AS u
	WHERE
		i.urbanizacion_id = u.id
		AND i.estado_incidente_id = 2
	ORDER BY fecha_registro DESC;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for pa_incidentes_por_ciudadano
-- ----------------------------
DROP PROCEDURE IF EXISTS `pa_incidentes_por_ciudadano`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `pa_incidentes_por_ciudadano`(IN parametro VARCHAR(8))
    COMMENT 'Procedimiento que lista los incidente registrados por ciudadano'
BEGIN
	IF(parametro = '') THEN
			SELECT 
					x.id, 
					x.descripcion, 
					x.direccion, 
					x.latitud, 
					x.longitud, 
					x.created_at,
					x.urbanizacion,
					x.territorio_vecinal,
					x.estado_incidente,
					x.persona_id,
					x.nombres,
					x.ape_paterno,
					x.ape_materno,
					x.dni,
					pe.nombres AS nombre_alcalde,
					pe.ape_paterno AS ape_paterno_alcalde,
					pe.ape_materno AS ape_materno_alcalde
				FROM
					(
								SELECT 
									i.id, i.descripcion, i.direccion, i.latitud, i.longitud, i.created_at,
									u.descripcion AS urbanizacion, tv.descripcion AS territorio_vecinal, 
									ei.descripcion AS estado_incidente, ti.descripcion AS tipo_incidente,
									i.persona_id,
									p.nombres, p.ape_paterno, p.ape_materno, p.dni
								FROM 
									incidente AS i,
									urbanizacion AS u,
									estado_incidente AS ei,
									tipo_incidente AS ti,
									territorio_vecinal AS tv,
									persona AS p
								WHERE i.urbanizacion_id = u.id
								AND i.estado_incidente_id = ei.id
								AND i.tipo_incidente_id = ti.id
								AND u.territorio_vecinal_id = tv.id
								AND i.persona_id = p.id	
					) AS x 
				LEFT JOIN 
						persona as pe 
				ON x.persona_id = pe.id
				WHERE pe.tipo_persona_id = 4
				ORDER BY x.created_at DESC;
	ELSE
			SELECT 
					x.id, 
					x.descripcion, 
					x.direccion, 
					x.latitud, 
					x.longitud, 
					x.created_at,
					x.urbanizacion,
					x.territorio_vecinal,
					x.estado_incidente,
					x.persona_id,
					x.nombres,
					x.ape_paterno,
					x.ape_materno,
					x.dni,
					pe.nombres AS nombre_alcalde,
					pe.ape_paterno AS ape_paterno_alcalde,
					pe.ape_materno AS ape_materno_alcalde
				FROM
					(
								SELECT 
									i.id, i.descripcion, i.direccion, i.latitud, i.longitud, i.created_at,
									u.descripcion AS urbanizacion, tv.descripcion AS territorio_vecinal, 
									ei.descripcion AS estado_incidente, ti.descripcion AS tipo_incidente,
									i.persona_id,
									p.nombres, p.ape_paterno, p.ape_materno, p.dni
								FROM 
									incidente AS i,
									urbanizacion AS u,
									estado_incidente AS ei,
									tipo_incidente AS ti,
									territorio_vecinal AS tv,
									persona AS p
								WHERE i.urbanizacion_id = u.id
								AND i.estado_incidente_id = ei.id
								AND i.tipo_incidente_id = ti.id
								AND u.territorio_vecinal_id = tv.id
								AND i.persona_id = p.id	
								AND (p.id = parametro OR p.dni = parametro)
					) AS x 
				LEFT JOIN 
						persona as pe 
				ON x.persona_id = pe.id
				WHERE pe.tipo_persona_id = 4
				ORDER BY x.created_at DESC;
	END IF;
				
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for pa_incidentes_por_tipo_incidente
-- ----------------------------
DROP PROCEDURE IF EXISTS `pa_incidentes_por_tipo_incidente`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `pa_incidentes_por_tipo_incidente`(
	IN estado_incidente_id INT, 
	IN fecha_inicio VARCHAR(12),
	IN fecha_final VARCHAR(12)
)
BEGIN
	IF(estado_incidente_id = 0 AND fecha_inicio = "" AND fecha_final = "") THEN
		SELECT i.id, DATE_FORMAT(i.fecha,"%d/%m/%Y") as fecha, i.direccion, i.descripcion, 
		u.descripcion AS urbanizacion, tv.descripcion AS territorio_vecinal,
		ei.descripcion AS estado_incidente
		FROM incidente i, estado_incidente AS ei, urbanizacion AS u, territorio_vecinal as tv
		WHERE i.estado_incidente_id = ei.id
		AND i.urbanizacion_id = u.id
		AND u.territorio_vecinal_id = tv.id;
		
	ELSEIF(estado_incidente_id != 0 AND fecha_inicio = "" AND fecha_final = "") THEN
		SELECT i.id, i.fecha, i.direccion, i.descripcion, 
		u.descripcion AS urbanizacion, tv.descripcion AS territorio_vecinal,
		ei.descripcion AS estado_incidente
		FROM incidente i, estado_incidente AS ei, urbanizacion AS u, territorio_vecinal as tv
		WHERE i.estado_incidente_id = ei.id
		AND i.urbanizacion_id = u.id
		AND u.territorio_vecinal_id = tv.id
		AND i.estado_incidente_id = estado_incidente_id;

	ELSEIF(estado_incidente_id != 0 AND fecha_inicio != "" AND fecha_final != "") THEN
		SELECT i.id, i.fecha, i.direccion, i.descripcion, 
		u.descripcion AS urbanizacion, tv.descripcion AS territorio_vecinal,
		ei.descripcion AS estado_incidente
		FROM incidente i, estado_incidente AS ei, urbanizacion AS u, territorio_vecinal as tv
		WHERE i.estado_incidente_id = ei.id
		AND i.urbanizacion_id = u.id
		AND u.territorio_vecinal_id = tv.id
		AND i.estado_incidente_id = estado_incidente_id
		AND i.fecha BETWEEN CAST(fecha_inicio AS DATE) AND CAST(fecha_final AS DATE);

	ELSEIF(estado_incidente_id = 0 AND fecha_inicio != "" AND fecha_final != "") THEN
		SELECT i.id, i.fecha, i.direccion, i.descripcion, 
		u.descripcion AS urbanizacion, tv.descripcion AS territorio_vecinal,
		ei.descripcion AS estado_incidente
		FROM incidente i, estado_incidente AS ei, urbanizacion AS u, territorio_vecinal as tv
		WHERE i.estado_incidente_id = ei.id
		AND i.urbanizacion_id = u.id
		AND u.territorio_vecinal_id = tv.id
		AND i.fecha BETWEEN CAST(fecha_inicio AS DATE) AND CAST(fecha_final AS DATE);

	END IF;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for pa_incidentes_registrados_fecha_update
-- ----------------------------
DROP PROCEDURE IF EXISTS `pa_incidentes_registrados_fecha_update`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `pa_incidentes_registrados_fecha_update`(
	IN estado_incidente_id INT
)
    COMMENT 'Procedimiento almacenado que lista los incidentes registrados por estado de incidente'
BEGIN
	IF(estado_incidente_id = 0 OR estado_incidente_id = -1) THEN
				SELECT 
					x.id, 
					x.descripcion, 
					x.direccion, 
					x.latitud, 
					x.longitud, 
					x.created_at,
					x.urbanizacion,
					x.territorio_vecinal,
					x.estado_incidente,
					x.persona_id,
					x.nombres,
					x.ape_paterno,
					x.ape_materno,
					pe.nombres AS nombre_alcalde,
					pe.ape_paterno AS ape_paterno_alcalde,
					pe.ape_materno AS ape_materno_alcalde
				FROM
					(
								SELECT 
									i.id, i.descripcion, i.direccion, i.latitud, i.longitud, i.created_at,
									u.descripcion AS urbanizacion, tv.descripcion AS territorio_vecinal, 
									ei.descripcion AS estado_incidente, ti.descripcion AS tipo_incidente,
									i.persona_id,
									p.nombres, p.ape_paterno, p.ape_materno
								FROM 
									incidente AS i,
									urbanizacion AS u,
									estado_incidente AS ei,
									tipo_incidente AS ti,
									territorio_vecinal AS tv,
									persona AS p
								WHERE i.urbanizacion_id = u.id
								AND i.estado_incidente_id = ei.id
								AND i.tipo_incidente_id = ti.id
								AND u.territorio_vecinal_id = tv.id
								AND i.persona_id = p.id			
					) AS x 
				LEFT JOIN 
						persona as pe 
				ON x.persona_id = pe.id
				AND pe.tipo_persona_id = 4
				ORDER BY x.created_at DESC;

	ELSE 
				SELECT 
					x.id, 
					x.descripcion, 
					x.direccion, 
					x.latitud, 
					x.longitud, 
					x.created_at,
					x.urbanizacion,
					x.territorio_vecinal,
					x.estado_incidente,
					x.persona_id,
					x.nombres,
					x.ape_paterno,
					x.ape_materno,
					pe.nombres AS nombre_alcalde,
					pe.ape_paterno AS ape_paterno_alcalde,
					pe.ape_materno AS ape_materno_alcalde
				FROM
					(
								SELECT 
									i.id, i.descripcion, i.direccion, i.latitud, i.longitud, i.created_at,
									u.descripcion AS urbanizacion, tv.descripcion AS territorio_vecinal, 
									ei.descripcion AS estado_incidente, ti.descripcion AS tipo_incidente,
									i.persona_id,
									p.nombres, p.ape_paterno, p.ape_materno
								FROM 
									incidente AS i,
									urbanizacion AS u,
									estado_incidente AS ei,
									tipo_incidente AS ti,
									territorio_vecinal AS tv,
									persona AS p
								WHERE i.urbanizacion_id = u.id
								AND i.estado_incidente_id = ei.id
								AND i.tipo_incidente_id = ti.id
								AND u.territorio_vecinal_id = tv.id
								AND i.persona_id = p.id			
								AND i.estado_incidente_id = estado_incidente_id
					) AS x 
				LEFT JOIN 
						persona as pe 
				ON x.persona_id = pe.id
				AND pe.tipo_persona_id = 4
				ORDER BY x.created_at DESC;

	END IF;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for pa_persona_mas_uso_aplicacion_fecha
-- ----------------------------
DROP PROCEDURE IF EXISTS `pa_persona_mas_uso_aplicacion_fecha`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `pa_persona_mas_uso_aplicacion_fecha`()
BEGIN
	SELECT
			x.id,
			x.ape_materno,
			x.ape_paterno,
			x.nombres,
			u.descripcion AS urbanizacion,
			t.descripcion AS territorioVecinal,
			x.desc1 AS incidente,
			x.desc2 AS confirmado,
			SUM(x.puntaje) AS puntaje
		FROM
			(
				SELECT
					p.id,
					p.ape_materno,
					p.ape_paterno,
					p.nombres,
					a.descripcion AS desc1,
					e.descripcion AS desc2,
					p.urbanizacion_id,
					a.puntaje
				FROM
					persona p,
					puntuacion_persona c,
					actividad_puntuacion a,
					estado_incidente e
				WHERE
					p.id = c.persona_id
				AND c.actividad_puntuacion_id = a.id
				AND a.estado_incidente_id = e.id
				AND c.numero_incidente = 0
				UNION ALL
					SELECT
						p.id,
						p.ape_materno,
						p.ape_paterno,
						p.nombres,
						a.descripcion AS desc1,
						e.descripcion AS desc2,
						p.urbanizacion_id,
						c.numero_incidente * a.puntaje AS puntaje
					FROM
						persona p,
						puntuacion_persona c,
						actividad_puntuacion a,
						estado_incidente e
					WHERE
						p.id = c.persona_id
					AND c.actividad_puntuacion_id = a.id
					AND a.estado_incidente_id = e.id
					AND c.numero_incidente > 0
			) x,
			urbanizacion u,
			territorio_vecinal t
		WHERE
			x.urbanizacion_id = u.id
		AND u.territorio_vecinal_id = t.id
		GROUP BY
			x.id,
			x.ape_materno,
			x.ape_paterno,
			x.nombres,
			u.descripcion,
			t.descripcion,
			x.desc1,
			x.desc2;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for pa_persona_registrada_fecha
-- ----------------------------
DROP PROCEDURE IF EXISTS `pa_persona_registrada_fecha`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `pa_persona_registrada_fecha`()
BEGIN
	SELECT
				x.id,
				x.ape_materno,
				x.ape_paterno,
				x.nombres,
        x.dni,
        x.mail,
				x.rol_id,
				x.descripcion,
        x.created_at AS fechaRegistro,
				u.descripcion AS urbanizacion,
				t.descripcion AS territorioVecinal,
				x.desc1 AS operacion,
				x.desc2 AS estado
			FROM
				(
					SELECT
						p.id,
						p.ape_materno,
						p.ape_paterno,
						p.nombres,
						p.rol_id,
						rl.descripcion,
            p.dni,
            p.mail,
            p.created_at,
						a.descripcion AS desc1,
						e.descripcion AS desc2,
						p.urbanizacion_id
					FROM
						persona p,
						puntuacion_persona c,
						actividad_puntuacion a,
						estado_incidente e,
						rol rl
					WHERE
						p.id = c.persona_id
					AND c.actividad_puntuacion_id = a.id
					AND a.estado_incidente_id = e.id
					AND c.numero_incidente = 0
					AND e.id = 2
				) x,
				urbanizacion u,
				territorio_vecinal t
			WHERE
				x.urbanizacion_id = u.id
			AND u.territorio_vecinal_id = t.id;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for pa_persona_registrada_fecha_update
-- ----------------------------
DROP PROCEDURE IF EXISTS `pa_persona_registrada_fecha_update`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `pa_persona_registrada_fecha_update`()
    COMMENT 'Procedimiento almacenado que lista las personas registradas hasta la fecha'
BEGIN
		SELECT
				x.persona_id,
				x.ape_materno,
				x.ape_paterno,
				x.nombres,
        x.dni,
        x.mail,
				x.roles,
        x.created_at AS fechaRegistro,
				u.descripcion AS urbanizacion,
				t.descripcion AS territorioVecinal,
				x.desc1 AS operacion,
				x.desc2 AS estado
		FROM
				(
					SELECT 
						u.id as user_id, 
						u.name user_nombre, u.persona_id,
						p.ape_paterno, 
						p.ape_materno, 
						p.nombres, 
						p.dni, p.mail,
						p.created_at,
						a.descripcion AS desc1,
						e.descripcion AS desc2,
						p.urbanizacion_id,
						GROUP_CONCAT(r.descripcion SEPARATOR ',') AS roles
					FROM 
						user_role AS ur, 
						users AS u, 
						rol AS r, 
						persona AS p,
						puntuacion_persona AS c,
						actividad_puntuacion AS a,
						estado_incidente AS e
					WHERE ur.role_id = r.id
						AND ur.user_id = u.id
						AND u.persona_id = p.id
						AND c.persona_id = p.id
						AND c.actividad_puntuacion_id = a.id
						AND a.estado_incidente_id = e.id
						AND c.numero_incidente = 0
						AND e.id = 2
						GROUP BY u.id, u.persona_id
						ORDER BY u.id ASC
				) x,
				urbanizacion as u,
				territorio_vecinal as t
		WHERE	
			x.urbanizacion_id = u.id
			AND u.territorio_vecinal_id = t.id;
END
;;
DELIMITER ;

