-- ----------------------------
-- Procedure structure for pa_territorio_mas_descarga
-- ----------------------------
DROP PROCEDURE IF EXISTS `pa_territorio_mas_descarga`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `pa_territorio_mas_descarga`(IN p_d_fechainicio DATE, IN p_d_fechafin DATE)
BEGIN
	SELECT t.descripcion, COUNT(p.id) AS descarga
 	FROM persona p, urbanizacion u,territorio_vecinal t
	WHERE p.urbanizacion_id=u.id
  	AND u.territorio_vecinal_id=t.id
    AND DATE(p.created_at) >= p_d_fechainicio AND DATE(p.created_at) <= p_d_fechafin
	GROUP BY t.descripcion;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for pa_usuarios_registrados_territorio_vecinal
-- ----------------------------
DROP PROCEDURE IF EXISTS `pa_usuarios_registrados_territorio_vecinal`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `pa_usuarios_registrados_territorio_vecinal`(
	IN fecha_inicio VARCHAR(12),
	IN fecha_final VARCHAR(12)
)
    COMMENT 'Procedimiento almacenado que lista el número de ciudadanos registrados por territorio vecinal'
BEGIN
	IF(fecha_inicio = '' AND fecha_final = '') THEN

		SELECT tv.id AS territorio_vecinal_id, tv.descripcion AS territorio_vecinal, COUNT(tv.id) AS total
		FROM users AS u, persona AS P, territorio_vecinal AS tv, urbanizacion AS urb
		WHERE u.persona_id = p.id
		AND p.urbanizacion_id = urb.id
		AND urb.territorio_vecinal_id = tv.id
		GROUP BY tv.id;

	ELSEIF(fecha_inicio != '' AND fecha_final = '') THEN

		SELECT tv.id AS territorio_vecinal_id, tv.descripcion AS territorio_vecinal, COUNT(tv.id) AS total
		FROM users AS u, persona AS P, territorio_vecinal AS tv, urbanizacion AS urb
		WHERE u.persona_id = p.id
		AND p.urbanizacion_id = urb.id
		AND urb.territorio_vecinal_id = tv.id
		AND u.created_at >= fecha_inicio
		GROUP BY tv.id;

	ELSEIF(fecha_inicio != '' AND fecha_final != '') THEN
	
		SELECT tv.id AS territorio_vecinal_id, tv.descripcion AS territorio_vecinal, COUNT(tv.id) AS total
		FROM users AS u, persona AS P, territorio_vecinal AS tv, urbanizacion AS urb
		WHERE u.persona_id = p.id
		AND p.urbanizacion_id = urb.id
		AND urb.territorio_vecinal_id = tv.id
		AND u.created_at >= fecha_inicio AND u.created_at <= fecha_final
		GROUP BY tv.id;

	ELSE

		SELECT tv.id AS territorio_vecinal_id, tv.descripcion AS territorio_vecinal, COUNT(tv.id) AS total
		FROM users AS u, persona AS P, territorio_vecinal AS tv, urbanizacion AS urb
		WHERE u.persona_id = p.id
		AND p.urbanizacion_id = urb.id
		AND urb.territorio_vecinal_id = tv.id
		AND u.created_at <= fecha_final
		GROUP BY tv.id;

	END IF;

END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for pa_usuario_mas_uso_simulacro
-- ----------------------------
DROP PROCEDURE IF EXISTS `pa_usuario_mas_uso_simulacro`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `pa_usuario_mas_uso_simulacro`(IN p_d_fechainicio DATE, IN p_d_fechafin DATE)
BEGIN
  SELECT	p.id, p.ape_paterno,	p.ape_materno, p.nombres,	DATE_FORMAT(i.fecha, '%d/%m/%Y') AS fecha, count(*) AS contador,
				( 
     SELECT COUNT(x.id_incidente) as numero_incidentes
            FROM (
                SELECT DISTINCT p.persona_id as id,
                                  p.numero_incidente AS id_incidente
                    FROM puntuacion_persona p, actividad_puntuacion a, estado_incidente e, incidente i
                   WHERE p.actividad_puntuacion_id=a.id
									 AND p.numero_incidente = i.id
                   AND a.estado_incidente_id=e.id
                   AND e.id=1 -- sin confirmar
									 AND p.numero_incidente <> 0 -- para que no sume el perfil aprobado
                   AND (DATE_FORMAT(i.fecha, '%d/%m/%Y') >= DATE_FORMAT(	p_d_fechainicio,	'%d/%m/%Y')
                   					AND DATE_FORMAT(i.fecha, '%d/%m/%Y') <= DATE_FORMAT(	p_d_fechafin,	'%d/%m/%Y'))
               ) x
         WHERE x.id=p.id
        ) as sin_confirmar,
        (
          SELECT COUNT(x.id_incidente) AS numero_incidentes
            FROM (
               SELECT DISTINCT p.persona_id AS id,
                                 p.numero_incidente AS id_incidente
                   FROM puntuacion_persona p, actividad_puntuacion a, estado_incidente e, incidente i
                  WHERE p.actividad_puntuacion_id=a.id
                  AND p.numero_incidente = i.id
                  AND a.estado_incidente_id=e.id                   
                  AND e.id=2 -- confirmado  
									AND p.numero_incidente <> 0 -- para que no sume el perfil aprobado
									AND (DATE_FORMAT(i.fecha, '%d/%m/%Y') >= DATE_FORMAT(	p_d_fechainicio,	'%d/%m/%Y')
					AND DATE_FORMAT(i.fecha, '%d/%m/%Y') <= DATE_FORMAT(	p_d_fechafin,	'%d/%m/%Y'))
              ) x
         WHERE x.id=p.id
          ) as confirmado,
         (
          SELECT COUNT(x.id_incidente) AS numero_incidentes
            FROM (
                SELECT DISTINCT p.persona_id AS id,
                                  p.numero_incidente AS id_incidente
                    FROM puntuacion_persona p, actividad_puntuacion a, estado_incidente e, incidente i
                   WHERE p.actividad_puntuacion_id=a.id
                   AND p.numero_incidente = i.id
                   AND a.estado_incidente_id=e.id
                   AND e.id=3 -- falso positivo 
									 AND p.numero_incidente <> 0 -- para que no sume el perfil aprobado
									AND (DATE_FORMAT(i.fecha, '%d/%m/%Y') >= DATE_FORMAT(	p_d_fechainicio,	'%d/%m/%Y')
					AND DATE_FORMAT(i.fecha, '%d/%m/%Y') <= DATE_FORMAT(	p_d_fechafin,	'%d/%m/%Y'))
               ) x
          WHERE x.id=p.id
         ) AS falso_positivo,

         (
         SELECT COUNT(x.id_incidente) AS numero_incidentes
           FROM (
              SELECT DISTINCT p.persona_id AS id,
                                p.numero_incidente AS id_incidente
                  FROM puntuacion_persona p, actividad_puntuacion a, estado_incidente e, incidente i
                 WHERE p.actividad_puntuacion_id=a.id
                 AND p.numero_incidente = i.id
                  AND a.estado_incidente_id=e.id
                 AND e.id=4 -- Atendido  
                 AND p.numero_incidente <> 0 -- para que no sume el perfil aprobado
									AND (DATE_FORMAT(i.fecha, '%d/%m/%Y') >= DATE_FORMAT(	p_d_fechainicio,	'%d/%m/%Y')
					AND DATE_FORMAT(i.fecha, '%d/%m/%Y') <= DATE_FORMAT(	p_d_fechafin,	'%d/%m/%Y'))
              ) x
           WHERE x.id=p.id
         ) AS atendido,
         (
          SELECT COUNT(x.id_incidente) AS numero_incidentes
           FROM (
               SELECT DISTINCT p.persona_id AS id,
                                 p.numero_incidente AS id_incidente
                   FROM puntuacion_persona p, actividad_puntuacion a, estado_incidente e, incidente i
                  WHERE p.actividad_puntuacion_id=a.id
                  AND p.numero_incidente = i.id
                  AND a.estado_incidente_id=e.id
                  AND e.id=5 -- en proceso
									AND p.numero_incidente <> 0 -- para que no sume el perfil aprobado
									AND (DATE_FORMAT(i.fecha, '%d/%m/%Y') >= DATE_FORMAT(	p_d_fechainicio,	'%d/%m/%Y')
					AND DATE_FORMAT(i.fecha, '%d/%m/%Y') <= DATE_FORMAT(	p_d_fechafin,	'%d/%m/%Y'))
							
              ) x
          WHERE x.id=p.id
         ) AS En_proceso,
     (
    SELECT SUM(x.numero_incidentes*a1.puntaje) puntaje_total
           FROM (
                 SELECT DISTINCT p.persona_id AS persona_id,
                                 p.actividad_puntuacion_id,
                            e.id AS estado_id,
                            COUNT(e.id) AS numero_incidentes
                   FROM puntuacion_persona p, actividad_puntuacion a, estado_incidente e, incidente i
                  WHERE p.actividad_puntuacion_id=a.id
									AND p.numero_incidente = i.id
                  AND a.estado_incidente_id=e.id
									AND (DATE_FORMAT(i.fecha, '%d/%m/%Y') >= DATE_FORMAT(	p_d_fechainicio,	'%d/%m/%Y')
					AND DATE_FORMAT(i.fecha, '%d/%m/%Y') <= DATE_FORMAT(	p_d_fechafin,	'%d/%m/%Y'))
									GROUP BY 1,2,3
									UNION
									SELECT DISTINCT p.persona_id AS persona_id,
                                 p.actividad_puntuacion_id,
                            e.id AS estado_id,
                            COUNT(e.id) AS numero_incidentes
                   FROM puntuacion_persona p, actividad_puntuacion a, estado_incidente e
                  WHERE p.actividad_puntuacion_id=a.id
									AND p.numero_incidente = 0
                  AND a.estado_incidente_id=e.id
               GROUP BY 1,2,3
            ) x, actividad_puntuacion a1
         WHERE x.actividad_puntuacion_id=a1.id
          AND x.estado_id=a1.estado_incidente_id
     AND x.persona_id=p.id		
    ) AS puntaje
FROM	incidente i,	persona p
WHERE	i.persona_id = p.id
 AND (DATE_FORMAT(i.fecha, '%d/%m/%Y') >= DATE_FORMAT(	p_d_fechainicio,	'%d/%m/%Y')
					AND DATE_FORMAT(i.fecha, '%d/%m/%Y') <= DATE_FORMAT(	p_d_fechafin,	'%d/%m/%Y'));
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for pa_usuario_mas_uso_simulacro_mas_uso_aplicacion
-- ----------------------------
DROP PROCEDURE IF EXISTS `pa_usuario_mas_uso_simulacro_mas_uso_aplicacion`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `pa_usuario_mas_uso_simulacro_mas_uso_aplicacion`(
	IN fecha_inicio VARCHAR(12),
	IN fecha_final VARCHAR(12)
)
    COMMENT 'Procedimiento almacenado que lista usuarios con más uso en simulacro y más uso de la aplicación'
BEGIN
	SELECT p.id, p.nombres, p.ape_paterno, p.ape_materno, DATE_FORMAT(i.fecha, '%d/%m/%Y') as fecha,
	(
		SELECT count(x.numero_incidente) AS total_incidentes FROM	
		(
			SELECT pp.persona_id, pp.numero_incidente FROM puntuacion_persona AS pp,
			persona AS p, actividad_puntuacion AS ap, incidente AS i, estado_incidente AS ei
			WHERE pp.persona_id = p.id
			AND pp.actividad_puntuacion_id = ap.id
			AND pp.numero_incidente = i.id
			AND ap.estado_incidente_id = ei.id
			AND pp.numero_incidente <> 0
			AND i.fecha >= fecha_inicio AND i.fecha <= fecha_final
			AND ei.id = 1
		) AS x
		WHERE x.persona_id = p.id
	) AS sin_confirmar,
	(
		SELECT count(x.numero_incidente) AS total_incidentes FROM	
		(
			SELECT pp.persona_id, pp.numero_incidente FROM puntuacion_persona AS pp,
			persona AS p, actividad_puntuacion AS ap, incidente AS i, estado_incidente AS ei
			WHERE pp.persona_id = p.id
			AND pp.actividad_puntuacion_id = ap.id
			AND pp.numero_incidente = i.id
			AND ap.estado_incidente_id = ei.id
			AND pp.numero_incidente <> 0
			AND i.fecha >= fecha_inicio AND i.fecha <= fecha_final
			AND ei.id = 2
		) AS x
		WHERE x.persona_id = p.id
	) AS confirmado,
	(
		SELECT count(x.numero_incidente) AS total_incidentes FROM	
		(
			SELECT pp.persona_id, pp.numero_incidente FROM puntuacion_persona AS pp,
			persona AS p, actividad_puntuacion AS ap, incidente AS i, estado_incidente AS ei
			WHERE pp.persona_id = p.id
			AND pp.actividad_puntuacion_id = ap.id
			AND pp.numero_incidente = i.id
			AND ap.estado_incidente_id = ei.id
			AND pp.numero_incidente <> 0
			AND i.fecha >= fecha_inicio AND i.fecha <= fecha_final
			AND ei.id = 3
		) AS x
		WHERE x.persona_id = p.id
	) AS falso_positivo,
	(
		SELECT count(x.numero_incidente) AS total_incidentes FROM	
		(
			SELECT pp.persona_id, pp.numero_incidente FROM puntuacion_persona AS pp,
			persona AS p, actividad_puntuacion AS ap, incidente AS i, estado_incidente AS ei
			WHERE pp.persona_id = p.id
			AND pp.actividad_puntuacion_id = ap.id
			AND pp.numero_incidente = i.id
			AND ap.estado_incidente_id = ei.id
			AND pp.numero_incidente <> 0
			AND i.fecha >= fecha_inicio AND i.fecha <= fecha_final
			AND ei.id = 4
		) AS x
		WHERE x.persona_id = p.id
	) AS atendidos,
	(
		SELECT count(x.numero_incidente) AS total_incidentes FROM	
		(
			SELECT pp.persona_id, pp.numero_incidente FROM puntuacion_persona AS pp,
			persona AS p, actividad_puntuacion AS ap, incidente AS i, estado_incidente AS ei
			WHERE pp.persona_id = p.id
			AND pp.actividad_puntuacion_id = ap.id
			AND pp.numero_incidente = i.id
			AND ap.estado_incidente_id = ei.id
			AND i.fecha >= fecha_inicio AND i.fecha <= fecha_final
			AND ei.id = 5
			AND pp.numero_incidente <> 0
		) AS x
		WHERE x.persona_id = p.id
	) AS en_proceso,
	(
		SELECT (sin_confirmar + confirmado + falso_positivo + atendidos + en_proceso) 
	) AS incidencias,
	(
		SELECT sum(x.numero_incidentes*a1.puntaje) puntaje_total
						 FROM (
									 SELECT DISTINCT p.persona_id AS persona_id,
																	 p.actividad_puntuacion_id,
															e.id AS estado_id,
															count(e.id) AS numero_incidentes
										 FROM puntuacion_persona p, actividad_puntuacion a, estado_incidente e, incidente i
										WHERE p.actividad_puntuacion_id=a.id
										AND p.numero_incidente = i.id
										AND a.estado_incidente_id=e.id
										AND i.fecha >= fecha_inicio AND i.fecha <= fecha_final
										-- AND DATE(i.fecha) >= p_d_fechainicio AND DATE(i.fecha) <= p_d_fechafin
										GROUP BY 1,2,3
										UNION
										SELECT DISTINCT p.persona_id AS persona_id,
																	 p.actividad_puntuacion_id,
															e.id AS estado_id,
															count(e.id) AS numero_incidentes
										 FROM puntuacion_persona p, actividad_puntuacion a, estado_incidente e
										WHERE p.actividad_puntuacion_id=a.id
										AND p.numero_incidente = 0
										AND a.estado_incidente_id=e.id
								 GROUP BY 1,2,3
							) x, actividad_puntuacion a1
					 WHERE x.actividad_puntuacion_id=a1.id
						AND x.estado_id=a1.estado_incidente_id
			 AND x.persona_id=p.id
	) AS puntaje
	FROM persona AS p, incidente AS i
	WHERE i.persona_id = i.id
	AND i.fecha >= fecha_inicio AND i.fecha <= fecha_final
	GROUP BY p.id, DATE_FORMAT(i.fecha, '%d/%m/%Y')
	ORDER BY incidencias DESC;

END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for pa_usuario_mas_uso_simulacro_test
-- ----------------------------
DROP PROCEDURE IF EXISTS `pa_usuario_mas_uso_simulacro_test`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `pa_usuario_mas_uso_simulacro_test`()
BEGIN
SELECT	p.id, p.ape_paterno,	p.ape_materno, p.nombres,	DATE_FORMAT(i.fecha, '%d/%m/%Y') as fecha, count(*) as contador,
				( 
     select count(x.id_incidente) as numero_incidentes
            from (
                select distinct p.persona_id as id,
                                  p.numero_incidente as id_incidente
                    from puntuacion_persona p, actividad_puntuacion a, estado_incidente e, incidente i
                   where p.actividad_puntuacion_id=a.id
									 and p.numero_incidente = i.id
                   and a.estado_incidente_id=e.id
                   and e.id=1 -- sin confirmar
									 and p.numero_incidente <> 0 -- para que no sume el perfil aprobado
									 -- AND DATE(i.fecha) >= p_d_fechainicio AND DATE(i.fecha) <= p_d_fechafin
									) x
         where x.id=p.id
        ) as sin_confirmar,
        (
          select count(x.id_incidente) as numero_incidentes
            from (
               select distinct p.persona_id as id,
                                 p.numero_incidente as id_incidente
                   from puntuacion_persona p, actividad_puntuacion a, estado_incidente e, incidente i
                  where p.actividad_puntuacion_id=a.id
                  and p.numero_incidente = i.id
                  and a.estado_incidente_id=e.id                   
                  and e.id=2 -- confirmado  
									and p.numero_incidente <> 0 -- para que no sume el perfil aprobado
									-- AND DATE(i.fecha) >= p_d_fechainicio AND DATE(i.fecha) <= p_d_fechafin
								) x
         where x.id=p.id
          ) as confirmado,
         (
          select count(x.id_incidente) as numero_incidentes
            from (
                select distinct p.persona_id as id,
                                  p.numero_incidente as id_incidente
                    from puntuacion_persona p, actividad_puntuacion a, estado_incidente e, incidente i
                   where p.actividad_puntuacion_id=a.id
                   and p.numero_incidente = i.id
                   and a.estado_incidente_id=e.id
                   and e.id=3 -- falso positivo 
									 and p.numero_incidente <> 0 -- para que no sume el perfil aprobado
									 -- AND DATE(i.fecha) >= p_d_fechainicio AND DATE(i.fecha) <= p_d_fechafin
								) x
          where x.id=p.id
         ) as falso_positivo,

         (
         select count(x.id_incidente) as numero_incidentes
           from (
              select distinct p.persona_id as id,
                                p.numero_incidente as id_incidente
                  from puntuacion_persona p, actividad_puntuacion a, estado_incidente e, incidente i
                 where p.actividad_puntuacion_id=a.id
                 and p.numero_incidente = i.id
                  and a.estado_incidente_id=e.id
                 and e.id=4 -- Atendido  
                 and p.numero_incidente <> 0 -- para que no sume el perfil aprobado
								 -- AND DATE(i.fecha) >= p_d_fechainicio AND DATE(i.fecha) <= p_d_fechafin
							) x
           where x.id=p.id
         ) as atendido,
         (
          select count(x.id_incidente) as numero_incidentes
           from (
               select distinct p.persona_id as id,
                                 p.numero_incidente as id_incidente
                   from puntuacion_persona p, actividad_puntuacion a, estado_incidente e, incidente i
                  where p.actividad_puntuacion_id=a.id
                  and p.numero_incidente = i.id
                  and a.estado_incidente_id=e.id
                  and e.id=5 -- en proceso
									and p.numero_incidente <> 0 -- para que no sume el perfil aprobado
									-- AND DATE(i.fecha) >= p_d_fechainicio AND DATE(i.fecha) <= p_d_fechafin
              ) x
          where x.id=p.id
         ) as En_proceso,
     (
    select sum(x.numero_incidentes*a1.puntaje) puntaje_total
           from (
                 select distinct p.persona_id as persona_id,
                                 p.actividad_puntuacion_id,
                            e.id as estado_id,
                            count(e.id) as numero_incidentes
                   from puntuacion_persona p, actividad_puntuacion a, estado_incidente e, incidente i
                  where p.actividad_puntuacion_id=a.id
									and p.numero_incidente = i.id
                  and a.estado_incidente_id=e.id
									-- AND DATE(i.fecha) >= p_d_fechainicio AND DATE(i.fecha) <= p_d_fechafin
									group by 1,2,3
									UNION
									select distinct p.persona_id as persona_id,
                                 p.actividad_puntuacion_id,
                            e.id as estado_id,
                            count(e.id) as numero_incidentes
                   from puntuacion_persona p, actividad_puntuacion a, estado_incidente e
                  where p.actividad_puntuacion_id=a.id
									and p.numero_incidente = 0
                  and a.estado_incidente_id=e.id
               group by 1,2,3
            ) x, actividad_puntuacion a1
         where x.actividad_puntuacion_id=a1.id
          and x.estado_id=a1.estado_incidente_id
     and x.persona_id=p.id		
    ) as puntaje
FROM	incidente i,	persona p
WHERE	i.persona_id = p.id
-- AND DATE(i.fecha) >= p_d_fechainicio AND DATE(i.fecha) <= p_d_fechafin
GROUP BY
	p.id,
	p.ape_materno,
	p.ape_paterno,
	p.nombres,
	DATE_FORMAT(i.fecha, '%d/%m/%Y');
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for pa_validacion_alcalde_vecinal
-- ----------------------------
DROP PROCEDURE IF EXISTS `pa_validacion_alcalde_vecinal`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `pa_validacion_alcalde_vecinal`(IN p_d_fechainicio DATE, IN p_d_fechafin DATE)
BEGIN
	SELECT
				i.persona_id_validador,
				p.ape_materno,
				p.ape_paterno,
				p.nombres,
				urb.descripcion AS urbanizacion,
				tv.descripcion AS territorioVecinal,
				COUNT(p.id) AS contador
			FROM
				incidente i,
				persona p
			INNER JOIN urbanizacion AS urb ON urb.id = p.urbanizacion_id 
			INNER JOIN territorio_vecinal AS tv ON tv.id = urb.territorio_vecinal_id
			WHERE
				i.persona_id_validador = p.id AND
        DATE(i.fecha) >= p_d_fechainicio AND DATE(i.fecha) <= p_d_fechafin
			GROUP BY
				p.id,
				p.ape_materno,
				p.ape_paterno,
				p.nombres;
END
;;
DELIMITER ;
